import logo from './logo.svg';
import './App.css';

function App() {
  const [users, setUsers] = useState([])

  const fetchUserData = () => {
    fetch("http://localhost:5000/")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setUsers(data)
      })
  }

  return (
    <div>
      Test
    </div>
  );
}

export default App;
